import React from "react"
import { FaCheck, FaQuestion } from 'react-icons/fa';
import { ImCross } from 'react-icons/im';

export default function RsvpListItem(props) {



    return (
        <li className="rsvpListItem" onClick={props.setSelected}>
            <p className="name">{props.person.name}</p>
            <p className="email">{props.person.email}</p>
            <p className="response">{
                props.person.response === "maybe" ?
                    <FaQuestion />
                    : props.pesron.response === "yes" ?
                        <FaCheck />
                        : <ImCross />
            }</p>
        </li>
    )
}
